  `ext_onum` varchar(250) NOT NULL DEFAULT '' COMMENT '外部订单号',
  `user_id` int(10) NOT NULL DEFAULT '0' COMMENT '用户ID',
  `saler_id` int(10) NOT NULL DEFAULT '0' COMMENT '销售ID',
  `type` tinyint(1) NOT NULL DEFAULT '0' COMMENT '订单类型，0：无 1.充值 2：浪币 3：课程 4：商品 5：咨询 6：礼物 7：朋友圈',
  `rel_id` int(10) NOT NULL DEFAULT '0' COMMENT '关联ID',
  `number` int(10) NOT NULL DEFAULT '0' COMMENT '数量',
  `amount` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '订单总价',
  `tutor_id` int(10) NOT NULL DEFAULT '0' COMMENT '指派导师',
  `tutor_ids` text NOT NULL COMMENT '指派导师',
  `pay_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '支付状态',
  `pay_type` varchar(250) NOT NULL DEFAULT '' COMMENT '支付方式',
  `pay_year` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付时间（年）',
  `pay_month` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付时间（年月）',
  `pay_day` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '支付时间（年月日）',
  `pay_time` int(10) NOT NULL DEFAULT '0' COMMENT '支付时间',
  `add_time` int(10) NOT NULL DEFAULT '0' COMMENT '下单时间',
  `remark` varchar(250) NOT NULL DEFAULT ' ' COMMENT '备注',
  `refund` tinyint(1) NOT NULL DEFAULT '0' COMMENT '退款订单',
  `refund_deal_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '退款处理状态',
  `refund_back_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '退款返回状态',
  `refund_money_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '退款金额状态',
  `refund_coupon_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '退款优惠劵状态',
  `refund_deal_time` int(10) NOT NULL DEFAULT '0' COMMENT '退款时间',
  `refund_add_time` int(10) NOT NULL DEFAULT '0' COMMENT '退款添加时间',
  `refund_status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '退款状态',
  `display` tinyint(1) NOT NULL DEFAULT '1' COMMENT '显示',
  `delete` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除',
  `status` tinyint(1) NOT NULL DEFAULT '0' COMMENT '状态',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=33802 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='订单表'");
